import React, { Component } from "react";
import "./App.css";
import Header from "./components/Header/Header";
import ChatHistory from "./components/ChatHistory/ChatHistory.jsx";
import { connect, sendMsg } from "./api";

class App extends Component {
  constructor(props) {
    super(props);
    connect();
  }

  send() {
    console.log("hello");
    sendMsg("hello");
  }

  render() {
    return (
      <div className="App">
        <Header />
        <ChatHistory />
        <button
          className=" mt-1 text-xl border-2 p-2 bg-slate-300 rounded-xl"
          onClick={this.send}
        >
          Hit
        </button>
      </div>
    );
  }
}

export default App;
